import styles from './Card.module.scss';
import clsx from 'clsx';
import Button from '../Button/Button.js';

const Card = props => {
  return (
    <ul>
      <li className={styles.card}>{props.title}
        < button><span className={clsx("fa fa-star-o", props.isFavourite === true && styles.active)}></span></button></li>
    </ul>
  );
};

export default Card;
